        <div className="header">
        <h1>{props.name}</h1>
        </div>
        <br /><br /><br /><br /><br /><br /><br /><br />
        <div className='sub-header'>
        
       <h2>BATMAN</h2>
       <h2>BATMAN</h2>
       <p>New Action || Old Fight</p>
        
        </div>
        
        
       
        

        </div>
    )
};

export default Landing;
